import React from 'react';

const GameOver = ({ score, time, penalty, initialBushes }) => {
    const penaltyMultiplier = 2;
    const overallScore = score - penalties * penaltyMultiplier / time;
  return (
    <div className="game-over">
      <h1>Game Over</h1>
      <h2>Overall Score: {overallScore}</h2>
      <p>Your Score: {score}</p>
      <p>Time: {time} + ({penalty} x 5) = {time  + (penalty*5)} seconds</p>
      <p>Penalties: {penalty}</p>
    </div>
  );
};

export default GameOver;
